package com.jhood.advent

import org.jhood.advent.DayFive
import org.scalatest.FunSuite

class DayFiveTest extends FunSuite {
  test("part 1 - solve the examples") {
    assert(DayFive.react("dabAcCaCBAcCcaDA") == "dabCBAcaDA")
  }

  test("part 1 - pass the test") {
    val result = DayFive.react(input)
    println(s"Day 5 Part 1 - ${result.length}")
  }

  test("part 2 - solve the example") {
    assert(DayFive.optimumRemoval("dabAcCaCBAcCcaDA") == "daDA")
  }

  test("part 2 - pass the test") {
    val result = DayFive.optimumRemoval(input)
    println(s"Day 5 Part 2 - ${result.length}")
  }

  private val input: String = ""
}
